import React from 'react';

const Certifications = () => {
  // Certifications data
  const certifications = [
    {
      id: 1,
      title: 'AWS Cloud Practitioner',
      issuer: 'Amazon Web Services',
      status: 'In Progress',
      expectedDate: 'Q4 2024',
      description: 'Foundational understanding of AWS Cloud concepts, services, and terminology.',
      skills: ['Cloud Computing', 'AWS Services', 'Security', 'Pricing'],
      badgeUrl: null, // Placeholder for badge image
      credentialUrl: null // Placeholder for credential verification
    },
    {
      id: 2,
      title: 'Google Business Intelligence Certificate',
      issuer: 'Google',
      status: 'Completed',
      completedDate: '2024',
      description: 'Comprehensive program covering data analysis, visualization, and business intelligence tools.',
      skills: ['Data Analysis', 'Business Intelligence', 'Data Visualization', 'Analytics'],
      badgeUrl: null,
      credentialUrl: '#' // Placeholder
    },
    {
      id: 3,
      title: 'n8n Automation Specialist',
      issuer: 'n8n',
      status: 'Completed',
      completedDate: '2024',
      description: 'Advanced workflow automation and integration platform expertise.',
      skills: ['Workflow Automation', 'API Integration', 'Process Optimization', 'No-Code Solutions'],
      badgeUrl: null,
      credentialUrl: '#' // Placeholder
    }
  ];

  return (
    <section id="certifications" className="py-20 bg-white">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        {/* Section header */}
        <div className="text-center mb-16">
          <h2 className="text-3xl sm:text-4xl font-bold text-gray-900 mb-4">
            Certifications
          </h2>
          <p className="text-lg text-gray-600 max-w-2xl mx-auto">
            Professional certifications that validate my expertise in cloud technologies, 
            data analysis, and automation platforms.
          </p>
        </div>

        {/* Certifications grid */}
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8">
          {certifications.map((cert) => (
            <div
              key={cert.id}
              className="bg-gray-50 rounded-xl p-6 hover:shadow-lg transition-shadow duration-300 border border-gray-200"
            >
              {/* Certification header */}
              <div className="flex items-start justify-between mb-4">
                <div className="flex-1">
                  <h3 className="text-lg font-semibold text-gray-900 mb-1">
                    {cert.title}
                  </h3>
                  <p className="text-sm text-gray-600">{cert.issuer}</p>
                </div>
                <div className="ml-4">
                  <span
                    className={`inline-flex items-center px-2.5 py-0.5 rounded-full text-xs font-medium ${
                      cert.status === 'Completed'
                        ? 'bg-green-100 text-green-800'
                        : cert.status === 'In Progress'
                        ? 'bg-yellow-100 text-yellow-800'
                        : 'bg-gray-100 text-gray-800'
                    }`}
                  >
                    {cert.status}
                  </span>
                </div>
              </div>

              {/* Date information */}
              <div className="mb-4">
                {cert.status === 'Completed' && cert.completedDate && (
                  <p className="text-sm text-gray-500">
                    Completed: {cert.completedDate}
                  </p>
                )}
                {cert.status === 'In Progress' && cert.expectedDate && (
                  <p className="text-sm text-gray-500">
                    Expected: {cert.expectedDate}
                  </p>
                )}
              </div>

              {/* Description */}
              <p className="text-gray-600 text-sm mb-4 leading-relaxed">
                {cert.description}
              </p>

              {/* Skills covered */}
              <div className="mb-4">
                <h4 className="text-sm font-medium text-gray-900 mb-2">
                  Key Skills:
                </h4>
                <div className="flex flex-wrap gap-1">
                  {cert.skills.map((skill, index) => (
                    <span
                      key={index}
                      className="inline-flex items-center px-2 py-1 rounded text-xs font-medium bg-primary-100 text-primary-800"
                    >
                      {skill}
                    </span>
                  ))}
                </div>
              </div>

              {/* Action buttons */}
              <div className="flex space-x-3">
                {cert.credentialUrl && (
                  <a
                    href={cert.credentialUrl}
                    className="inline-flex items-center px-3 py-2 border border-gray-300 rounded-md shadow-sm text-xs font-medium text-gray-700 bg-white hover:bg-gray-50 transition-colors duration-200"
                  >
                    <svg className="w-3 h-3 mr-1" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                      <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M9 12l2 2 4-4m6 2a9 9 0 11-18 0 9 9 0 0118 0z" />
                    </svg>
                    Verify
                  </a>
                )}
                {cert.badgeUrl && (
                  <a
                    href={cert.badgeUrl}
                    className="inline-flex items-center px-3 py-2 border border-gray-300 rounded-md shadow-sm text-xs font-medium text-gray-700 bg-white hover:bg-gray-50 transition-colors duration-200"
                  >
                    <svg className="w-3 h-3 mr-1" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                      <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M4.318 6.318a4.5 4.5 0 000 6.364L12 20.364l7.682-7.682a4.5 4.5 0 00-6.364-6.364L12 7.636l-1.318-1.318a4.5 4.5 0 00-6.364 0z" />
                    </svg>
                    Badge
                  </a>
                )}
              </div>
            </div>
          ))}
        </div>

        {/* Additional certifications pursuit */}
        <div className="mt-16 text-center">
          <div className="bg-gradient-to-r from-primary-50 to-blue-50 rounded-xl p-8">
            <h3 className="text-xl font-semibold text-gray-900 mb-4">
              Continuous Learning
            </h3>
            <p className="text-gray-600 max-w-3xl mx-auto mb-6">
              I'm actively pursuing additional certifications to stay current with cloud technologies and DevOps practices. 
              Next up: AWS Solutions Architect Associate and Docker Certified Associate.
            </p>
            <div className="flex flex-wrap justify-center gap-3">
              {['AWS Solutions Architect', 'Docker Certified Associate', 'Kubernetes Administrator', 'Terraform Associate'].map((cert) => (
                <span
                  key={cert}
                  className="px-4 py-2 bg-white text-gray-700 rounded-full shadow-sm border border-gray-200 text-sm font-medium"
                >
                  {cert}
                </span>
              ))}
            </div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Certifications;
